import './Dashboard.css';
import mock from '../../data/mock.json'

function Dashboard() {
    console.log(mock.data.userInfos.firstName)
    return (
        <div id='dashboard'>
            <h2>Bonjour, {mock.data.userInfos.firstName}</h2>        </div>
    );
}

export default Dashboard;
